import React from "react";
import Header from "../../components/header/Header";
function Signup(){
    return(
        <div>
            <Header/>
            <h2>Sign up to get started. It's free and always will be.</h2>
            <div className="container">
            <label>Full name</label>
            <input type="text"/>
            <label>Email</label>
            <input type="email"/>
            <label>Phone</label>
            <input type="number"/>
            <label>Password</label>
            <input type="password"/>
            <label>Confirm password</label>
            <input type="password"/>
            <button>Sign Up</button>
        </div>
        </div>
    );
}
export default Signup;
